import React from "react";
import ReactDOM from "react-dom/client";

class Application extends React.Component {
	render () {
		return (
			<h1> I am a wrapper for whatever app goes here </h1>
		);
	}
}

class BarBottom extends React.Component {
  render () {
    return (
      <div>
				<div> {this.props.contact.phone} </div>
			</div>
    );
  }
}

class BarTop extends React.Component {
	render () {
		return (
			<h1> I am the top bar </h1>
		);
	}
}

class Root extends React.Component {
	constructor (props) {
		super (props);
		this.contact = {
			address_l1:	"115 Library Drive",
			address_l2:	"Engineering Center, Room 301",
			city:				"Rochester",
			state:			"MI",
			zip_code:		"48309-4479",
			phone:			"(248) 370-2217",
		};
	}
	render () {
		return (
			<body>
				<BarTop />
				<Application />
				<BarBottom contact = {this.contact}/>
			</body>
		);
	}
}

const root = ReactDOM.createRoot (document.getElementById ("root"));
root.render (<Root />);
